import React from 'react';

const item1 = require("../picture/bussiness.jpg");

class Main extends React.Component{

    render(){
        return(
            <main>
                <div className="item1">
                    <img className="item1-img" src={item1}/>
                    <h3></h3>
                </div>
                <div className="item2">
                    <img className="item2-img"/>
                    <h3></h3>
                </div>
                <div className="item3">
                    <img className="item3-img"/>
                    <h3></h3>
                </div>
                <div className="item4">
                    <img className="item4-img"/>
                    <h3></h3>
                </div>
            </main>
        );
    }
}

export default Main;
